import React, { Component } from 'react';
import ReactDOM from 'react-dom';


class Menu extends Component {

    render() {
        return (
            <div>
                <nav>
                    <ul className='menu'>
                        <li className='menu__itens'><a href='#'>Home</a></li>
                        <li className='menu__itens'><a href='#'>FAQ</a></li>
                        <li className='menu__itens'><a href='#'>Locais</a></li>
                        <li className='menu__itens'><a href='#'>Categorias</a></li>
                    </ul>
                </nav>
            </div>
        )
    };
}

export default Menu;
